  get chevronRight() {
    return require('./chevronRight.png');
  },
  get plusSmall() {
    return require('./plusSmall.png');
  },
  get search() {
    return require('./search.png');
  },
  get settings() {
    return require('./settings.png');
  },
  get x() {
    return require('./x.png');
  }
};
